import './App.css';
import ieslaveredalogo from './imagenes/ieslavereda.png';

function App() {
  return (
    <div className="App">
      <div className='ieslavereda-logo-contenedor'>
        <img 
          className='ieslavereda-logo'
          src={ieslaveredalogo}
          alt='Logo de IES La Vereda' />
      </div>
      <div className="contenedor-principal">

      </div>

    </div>
  );
}

export default App;
